  useEffect(() => {
    axios.get(`https://jsonplaceholder.typicode.com/posts/${value}`).then((response) => {
      console.log("response", response);
      setLocalData(response.data);
    });
  }, []);
  console.log("localData", localData);
  return (
    <div>
      {localData.map((list) => {
        return (
          <>
            <h1>{list.title}</h1>
          </>
        );
      })}
    </div>
  );
}

export default GetImagesFromLocalApi;
